def RandomRotationMatrix():

    rv = np.random.rand(3)
    pi = np.pi

    R = np.zeros((3,3))
    theta = rv[0] * pi * 2
    phi   = rv[1] * pi * 2
    z     = rv[2] * 2.0

    r  = sqrt(z)
    Vx = sin(phi) * r
    Vy = cos(phi) * r
    Vz = sqrt(2.0 - z)

    st = sin(theta)
    ct = cos(theta)
    Sx = Vx * ct - Vy * st
    Sy = Vx * st + Vy * ct

    R[0,0] = Vx * Sx - ct
    R[0,1] = Vx * Sy - st
    R[0,2] = Vx * Vz

    R[1,0] = Vy * Sx + st
    R[1,1] = Vy * Sy - ct
    R[1,2] = Vy * Vz

    R[2,0] = Vz * Sx
    R[2,1] = Vz * Sy
    R[2,2] = 1.0 - z

    return R


