def plotVec(v,index):
    return [0,v[index]]

def avg_radii_wrt_z():

    a=5
    b=3
    c=2

    va = [a*0.565898,a*0.609046, a*0.555718]
    vb = [-b*0.764861,b*0.639448,b*0.0780625]
    vc = [-c*0.307809,-c*0.469223,c*0.827698]
    van = [-x for x in va]
    vbn = [-x for x in vb]
    vcn = [-x for x in vc]

    fig = plt.figure()
    ax = fig.add_subplot(111, projection='3d')

    ax.set_xlim([-3,3])
    ax.set_ylim([-3,3])
    ax.set_zlim([-3,3])

    ax.plot(plotVec(va,0),plotVec(va,1),zs=plotVec(va,2),lw=4,color='red',label='a')
    ax.plot(plotVec(vb,0),plotVec(vb,1),zs=plotVec(vb,2),lw=4,color='green',label='b')
    ax.plot(plotVec(vc,0),plotVec(vc,1),zs=plotVec(vc,2),lw=4,color='blue',label='c')
    ax.plot(plotVec(van,0),plotVec(van,1),zs=plotVec(van,2),lw=4,color='red',alpha=0.25)
    ax.plot(plotVec(vbn,0),plotVec(vbn,1),zs=plotVec(vbn,2),lw=4,color='green',alpha=0.25)
    ax.plot(plotVec(vcn,0),plotVec(vcn,1),zs=plotVec(vcn,2),lw=4,color='blue',alpha=0.25)

    avgRadii = [(x+y+z)/3 for x,y,z in zip(va,vb,vc)]
    scaledAvgRadii = [(x*a+y*b+z*c)/(a+b+c) for x,y,z in zip(va,vb,vc)]

    ax.scatter(avgRadii[0], avgRadii[1], zs=avgRadii[2], s=20, c='purple')
    ax.scatter(scaledAvgRadii[0], scaledAvgRadii[1], zs=scaledAvgRadii[2], s=20, c='orange')

    ax.legend()

    plt.show()

