def productOfREntriesDist():

    X = np.zeros((2,4,500000))

    for i in range(500000):
        R = RandomRotationMatrix()
        r11 = R[0,0]
        r12 = R[0,1]
        r13 = R[0,2]

        r21 = R[1,0]
        r22 = R[1,1]
        r23 = R[1,2]

        r31 = R[2,0]
        r32 = R[2,1]
        r33 = R[2,2]

        X[0,0,i] = r11*r13
        X[0,1,i] = r21*r23
        X[0,2,i] = r31*r33
        X[0,3,i] = X[0,0,i] + X[0,1,i] + X[0,2,i]

        X[1,0,i] = r12*r13
        X[1,1,i] = r22*r23
        X[1,2,i] = r32*r33
        X[1,3,i] = X[1,0,i] + X[1,1,i] + X[1,2,i]

    plt.subplot(4,2,1)
    plt.title('r11*r13')
    plt.hist(X[0,0,:],bins=50)

    plt.subplot(4,2,2)
    plt.title('r21*r23')
    plt.hist(X[0,1,:],bins=50)

    plt.subplot(4,2,3)
    plt.title('r31*r33')
    plt.hist(X[0,2,:],bins=50)

    plt.subplot(4,2,4)
    plt.title('+++')
    plt.hist(X[0,3,:],bins=50)

    plt.subplot(4,2,5)
    plt.title('r12*r13')
    plt.hist(X[1,0,:],bins=50)

    plt.subplot(4,2,6)
    plt.title('r22*r23')
    plt.hist(X[1,1,:],bins=50)

