    rolling_kx = []
    rolling_ky = []
    for i, x in enumerate(zVals):
        kx = 0.0
        ky = 0.0
        n = 0.0

        for j in range(len(kxs)):
            if x >= E_z_begin[j] and x <= E_z_end[j]:
                kx += kxs[j]
                ky += kys[j]
                n += 1.0

        if n > 0:
            rolling_kx.append(kx / n)
            rolling_ky.append(ky / n)
        else:
            rolling_kx.append(0)
            rolling_ky.append(0)

    smoothed_kx = gauss(rolling_kx, 15.0)
    smoothed_ky = gauss(rolling_ky, 15.0)

    p1 = plt.step(zVals, rolling_kx)
    p2 = plt.step(zVals, rolling_ky)
    p3 = plt.plot(zVals, smoothed_kx)
    p4 = plt.plot(zVals, smoothed_ky)

    plt.xlabel('z')

