                F = -sqZ*sq2Z*(((a-b)*Z*cX**3+((c-a)*Z-c)*cX+sX*a)*sY+(a-b)*Z*cYcX**3+((c-a)*Z+b-c)*cYcX)
                C = ((a-b)*Z**2+2*(b-a)*Z)*cX**2+(c-a)*Z**2+2*(a-c)*Z+c
                Ekx = (((a-b)*sY*cX**3+(-a+b)*sX*cY*cX**2+(-a+c)*sY*cX+(a-c)*sX*cY)*Z**(3./2.)+((b-c)*sY*cX+(-a+c)*sX*cY)*sqZ)*sq2Z+((Z**2-2.*Z)*a-Z**2*b+2.*Z*b)*kx*cX**2+((-Z**2+2.*Z)*a+c-2.*c*Z+c*Z**2)*kx

                E2.append(E)
                F2.append(F)
                C2.append(C)
                EC2.append(-E/C)
                FC2.append(-F/C)
